export default function Card(props) {
   return (
      <div>
         <button onClick={()=>{props.onClose()}}>X</button>
         <p>Name: {props.name}</p>
         <p>Status: {props.status}</p>
         <p>Specie: {props.species}</p>
         <p>Gender: {props.gender}</p>
         <p>Origin: {props.origin.name}</p>
         <img src={props.image} alt="" />
      </div>
   );
}
